
local centerx=nil
local centery=nil
local centerz=nil
local TOLERANCE=150

local function Add(ms,fileid,x,y,z,scale,yaw,pitch,roll)
	x=x-centerx
	y=y-centery
	z=z-centerz
	local xdist=x
	local ydist=y
	local zdist=z
	local distsqr=xdist*xdist+ydist*ydist+zdist*zdist	
	
	if(distsqr<=TOLERANCE*TOLERANCE and scale>0)then
		-- if(fileid==3759600)then
			local a=ms:AddActorByFileID(fileid,x,y,z,scale,yaw,pitch,roll)			
			-- print("M2:",fileid,x,y,z,scale,yaw,pitch,roll)	
			-- print(a:GetPosition())
		-- end
		--print("M2:",fileid,x,y,z)
	end
	-- if(fileid==3759600)then
		-- print("Found a 3759600 at",x,y,z)
	-- end	
	return ms
end

local function obj(base,modifiers,...)
	local args={...}
	local ms=XPRACTICE.AMIRDRASSILRAIDMAPS.multisolid
	local fileid=base[1]	
	local actor=Add(ms,fileid,base[2],base[3],base[4],base[5],base[6],base[7],base[8])
	for i=1,#args do
		x=args[i][1]
		y=args[i][2]
		--
		z=base[4]
		scale=base[5]
		yaw=base[6]
		pitch=base[7]
		roll=base[8]
		for j=1,#modifiers do
			local mod=string.sub(modifiers,j,j)
			if(mod=="Z")then
				z=args[i][j+2]
			elseif(mod=="S")then
				scale=args[i][j+2]
			elseif(mod=="Y")then
				yaw=args[i][j+2]
			elseif(mod=="P")then
				pitch=args[i][j+2]
			elseif(mod=="R")then
				roll=args[i][j+2]
			else
				error("Malformed modifier string \""..modifiers.."\" in SceneryData.");
			end
		end
		local actor=Add(ms,fileid,x,y,z,scale,yaw,pitch,roll)

		
	end
end

